import React, { useState, useEffect } from 'react';
import {
  IonContent,
  IonHeader,
  IonPage,
  IonTitle,
  IonToolbar,
  IonButton,
} from '@ionic/react';

function App() {
  const [imageUrl, setImageUrl] = useState('');

  const fetchRandomImage = () => {
    // Defina a URL da imagem diretamente
    const imageUrl = 'https://pic.re/image';

    setImageUrl(imageUrl);
  }

  useEffect(() => {
    fetchRandomImage();
  }, []);

  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Imagem da API</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>
        <div style={{ width: '400px', height: '300px' }}>
          <img src={imageUrl} alt="Imagem da API" />
        </div>
        <IonButton expand="full" onClick={fetchRandomImage}>
          Buscar Nova Imagem
        </IonButton>
      </IonContent>
    </IonPage>
  );
}

export default App;
